import React, { Component } from 'react';
import './links.css';

class Links extends Component {
  navigateTo(page) {
    window.location.href = page;
  }

  render() {
    return (
      <div id="links-page-container">
        <div id="links-title-container">
          Links:
        </div>
        <div id="links-container">
          {/* <ul> */}
            <p>
              <a href='https://www.linkedin.com/in/natwag/'>My LinkedIn Profile</a>
            </p>
            <p>
              <a href='https://github.com/nat82alie'>My Github</a>
            </p>
          {/* </ul> */}
        </div>
      </div>
    );
  }
}

export default Links;
